import Tag from "./components/Tag";
function App() {
  

  return (
    <div className="w-full h-screen flex flex-col background relative">
        <h1 className='absolute bg-white rounded-sm w-full '>RANDOM GIFS</h1>
        <div className=" flex flex-col">
            <Random/>
            <Tag/>
        </div>
    </div>
  );
}

export default App;
